!

!
version 12.1
no service single-slot-reload-enable
service timestamps debug datetime msec
service timestamps log datetime msec
no service password-encryption
!
hostname R6
!
!
!
!
!
!
ip subnet-zero
no ip icmp rate-limit unreachable
ip cef
ip tcp synwait-time 5
no ip domain-lookup
!
!
!
!
!
!
!
!
interface FastEthernet0/0
 no ip address
 shutdown
 duplex auto
 speed auto
!
interface Ethernet1/0
 ip address 137.0.104.89 255.255.255.248
!
interface Ethernet2/0
 ip address 137.0.104.129 255.255.255.248
!
interface Ethernet2/1
 ip address 137.0.104.97 255.255.255.248
!
interface Ethernet2/2
 no ip address
 shutdown
!
interface Ethernet2/3
 no ip address
 shutdown
!
ip classless
ip route 0.0.0.0 0.0.0.0 137.0.104.90
ip route 137.0.104.64 255.255.255.192 137.0.104.90
ip route 137.0.104.96 255.255.255.224 137.0.104.98
ip route 137.0.104.96 255.255.255.240 137.0.104.98
ip route 137.0.104.104 255.255.255.248 137.0.104.106
ip route 137.0.104.128 255.255.255.224 137.0.104.130
no ip http server
!
!
!
line con 0
 exec-timeout 0 0
 privilege level 15
 logging synchronous
line aux 0
 exec-timeout 0 0
 privilege level 15
 logging synchronous
line vty 0 4
 login
!
end
